import './App.css';


const Person = (props) => {
  return (
    <>
    <h1>Class: {props.class}</h1>
    <h2>Spec: {props.spec}</h2>
    <h3>Race: {props.race}</h3>
    </>
  )
}

const App = () => {
  return (
    <div className="App">
      <h1>
        <Person />
      </h1>
    </div>
  );
}

export default App;
